import React from "react";
import ReactDOM from "react-dom";
import "../componentCss/ExperiencesCss.css";

class Experiences extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { time, name, describe, place } = this.props;
    return (
      <div>
        <h1> {time} </h1>
        <h1> {name}</h1>
      </div>
    );
  }
}

export default Experiences;
